holder\"\n        multiline\n        className={classes.textField}\n        margin=\"normal\"\n      />\n      <TextField\n        id=\"standard-number\"\n        label=\"Number\"\n        value={values.age}\n        onChange={handleChange('age')}\n        type=\"number\"\n        className={classes.textField}\n        InputLabelProps={{\n          shrink: true,\n        }}\n        margin=\"normal\"\n      />\n      <TextField\n        id=\"standard-search\"\n        label=\"Search field\"\n        type=\"search\"\n        className={classes.textField}\n        margin=\"normal\"\n      />\n      <TextField\n        id=\"standard-select-currency\"\n        select\n        label=\"Select\"\n        className={classes.textField}\n        value={values.currency}\n        onChange={handleChange('currency')}\n        SelectProps={{\n          MenuProps: {\n            className: classes.menu,\n          },\n        }}\n        helperText=\"Please select your currency\"\n        margin=\"normal\"\n      >\n        {currencies.map(option => (\n          <MenuItem key={option.value} value={option.value}>\n            {option.label}\n          </MenuItem>\n        ))}\n      </TextField>\n      <TextField\n        id=\"standard-select-currency-native\"\n        select\n        label=\"Native select\"\n        className={classes.textField}\n        value={values.currency}\n        onChange={handleChange('currency')}\n        SelectProps={{\n          native: true,\n          MenuProps: {\n            className: classes.menu,\n          },\n        }}\n        helperText=\"Please select your currency\"\n        margin=\"normal\"\n      >\n        {currencies.map(option => (\n          <option key={option.value} value={option.value}>\n            {option.label}\n          </option>\n        ))}\n      </TextField>\n      <TextField\n        id=\"standard-full-width\"\n        label=\"Label\"\n        style={{ margin: 8 }}\n        placeholder=\"Placeholder\"\n        helperText