/* eslint-disable no-restricted-imports */
import React, { useState,useEffect } from 'react';
import axios from 'axios';
import clsx from "clsx";
import {
  TextField,
  InputBase,

} from "@material-ui/core";
import { useHistory, useParams } from 'react-router-dom';
import {green} from "@material-ui/core/colors";
import {
  fade,
  withStyles,
  makeStyles,
  createMuiTheme
} from "@material-ui/core/styles";

import {Notice, KTCodeExample} from "../../_metronic/_partials/controls";
import MenuItem from '@material-ui/core/MenuItem';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import Button from '@material-ui/core/Button';





// Submit
const useStyles3 = makeStyles(theme => ({
  button: {
    margin: theme.spacing(1),
  }, 
  input: {
    display: 'none',
  },
}));


const currencies = [
  {
    value: 'Active',
    label: 'Active',
  },
  {
    value: 'Inactive',
    label: 'Inactive',
  },
];

//view user
const useStyles4 = makeStyles(theme => ({
  root: {
    width: '100%',
    marginTop: theme.spacing(3),
    overflowX: 'auto',
  },
  table: {
    minWidth: 650,
  },
}));

const User = () => {
  const [user, setUser] = useState({
    name: "",
    username: "",
    email: "",
    phone: "",
    webiste: ""
  });
  useEffect(() => {
    viewUser();
  }, []);

const viewUser = fetch('http://13.232.102.139:9000/user/', {
  method: "GET",
  headers: { 'Content-Type': 'application/json','Authorization': 'Bearer nFMjOROg5xdWVt1gG0wAcWdEd' },
})
.then(response => response.json()) 
.then(data => setUser(data)); 

const printIt = (data) => {
  const rows=data.data
  console.log(rows)
}

}


function createData(name, email, mobile, account_type,status) {
  return { name, email, mobile, account_type,status };
}

const rows = [
  createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
  createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
  createData('Eclair', 262, 16.0, 24, 6.0),
  createData('Cupcake', 305, 3.7, 67, 4.3),
  createData('Gingerbread', 356, 16.0, 49, 3.9),
]
// add user



const useStyles2 = makeStyles(theme => ({
  container: {
    display: "flex",
    flexWrap: "wrap"
  },
  textField: {
    marginLeft: theme.spacing(1),
    marginRight: theme.spacing(1)
  },
  dense: {
    marginTop: theme.spacing(2)
  },
  menu: {
    width: 200
  }
}));




export default function TextFieldsExamplesPage() {

// submit button
  const classes3 = useStyles3();
  //view user
  const classes4 = useStyles4(); 
  // add user

  const classes2 = useStyles2();
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [mobile, setMobile] = useState("");
  const [password, setPassword] = useState("");
  const [account_type,setAccount_type] = useState("");
  
  const history = useHistory();



  function Useradd(e){
    e.preventDefault()
    const postData ={
      name,
      email,
      mobile,
      password,
      account_type
      }

    console.log(typeof postData);
    console.log(postData)

    

      // POST request using fetch inside useEffect React hook
      const requestOptions = {
          method: 'POST',
          headers: { 'Content-Type': 'application/json','Authorization': 'Bearer nFMjOROg5xdWVt1gG0wAcWdEd' },
          body: JSON.stringify(postData)
      };
      fetch('http://13.232.102.139:9000/user/add', requestOptions)
          .then(response => response.json())
          .then(data => postData);
      history.push("/");
     
    }


  return ( 
    <>

      <div className="row">
        <div className="col-md-4">
          <KTCodeExample
            jsCode={jsCode2}
            beforeCodeTitle="Add User"
            codeBlockHeight="400px"
          >
            <span>
              <code>TextField</code> supports outlined styling.
            </span>
            <div className="separator separator-dashed my-7"></div>
            <form className={classes2.container} noValidate autoComplete="off" >
              <TextField
                id="outlined-name"
                label="Name"
                className={classes2.textField}
                value={name}
                onChange={(e)=> setName(e.target.value)}
                margin="normal"
                variant="outlined"
              />

              <TextField
                
                id="outlined-error"
                label="Account Type"
                value={account_type}
                className={classes2.textField}
                onChange={(e)=> setAccount_type(e.target.value)}
                margin="normal"
                variant="outlined"
              />

              <TextField
                id="outlined-email-input"
                label="Email"
                className={classes2.textField}
                type="email"
                value={email}
                autoComplete="email"
                margin="normal"
                variant="outlined"
                onChange={(e)=> setEmail(e.target.value)}
              />
              <TextField
                id="outlined-password-input"
                label="Password"
                className={classes2.textField}
                type="password"
                value={password}
                autoComplete="current-password"
                margin="normal"
                variant="outlined"
                onChange={(e)=> setPassword(e.target.value)}
              />
              <TextField
                id="outlined-read-only-input"
                label="Phone"
                type= "number"
                value={mobile}
                className={classes2.textField}
                margin="normal"
                variant="outlined"
                onChange={(e)=> setMobile(e.target.value)}
              />
              {/* <TextField
                id="outlined-select-currency"
                select
                label="Status"
                className={classes2.textField}
                value={users.currency}
                onChange={handleChange2("currency")}
                SelectProps={{
                  MenuProps: {
                    className: classes2.menu
                  }
                }}
                margin="normal"
                variant="outlined"
              >
                {currencies.map(option => (
                  <MenuItem key={option.value} value={option.value}>
                    {option.label}
                  </MenuItem>
                ))}
              </TextField> */}
              <Button variant="contained" className={classes3.button} onClick ={Useradd}>

                Submit
              </Button>
            </form>
            
          </KTCodeExample>
        </div>

        <div className="col-md-8">
        <KTCodeExample
            jsCode={jsCode4}
            beforeCodeTitle="View User"
            codeBlockHeight="400px"
          >
          <Paper className={classes4.root}>
            <Table className={classes4.table}>
              <TableHead>
                <TableRow>
                  <TableCell>Name</TableCell>
                  <TableCell align="right">Account type</TableCell>
                  <TableCell align="right">Email</TableCell>
                  <TableCell align="right">Phone</TableCell>
                  <TableCell align="right">Status</TableCell>
                  <TableCell align="centre">Action</TableCell>
                  
                </TableRow>
              </TableHead>
              <TableBody>
                {rows.map(row => (
                  <TableRow key={row.name}>
                    <TableCell component="th" scope="row">
                      {row.name}
                    </TableCell>
                    <TableCell align="right">{row.calories}</TableCell>
                    <TableCell align="right">{row.fat}</TableCell>
                    <TableCell align="right">{row.carbs}</TableCell>
                    <TableCell align="right">{row.protein}</TableCell>
                    <TableCell allign="right">
                    <Button >
                    <i class="fas fa-eye"></i>
                    </Button>
                    <Button >
                    <i class="fa fa-edit"></i>
                    </Button>
                    <Button>
                    <i class="fa fa-trash"></i>
                    </Button>
                    </TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </Paper>
          </KTCodeExample>
        </div>
      </div>
    </>
  );
}

const jsCode1 = `
import React from 'react';
import clsx from 'clsx';
import { makeStyles } from '@material-ui/core/styles';
import MenuItem from '@material-ui/core/MenuItem';
import TextField from '@material-ui/core/TextField';

const useStyles = makeStyles(theme => ({
  container: {
    display: 'flex',
    flexWrap: 'wrap',
  },
  textField: {
    marginLeft: theme.spacing(1),
    marginRight: theme.spacing(1),
    width: 200,
  },
  dense: {
    marginTop: 19,
  },
  menu: {
    width: 200,
  },
}));

const currencies = [
  {
    value: 'USD',
    label: '$',
  },
  {
    value: 'EUR',
    label: '€',
  },
  {
    value: 'BTC',
    label: '฿',
  },
  {
    value: 'JPY',
    label: '¥',
  },
];

export default function TextFields() {
  const classes = useStyles();
  const [values, setValues] = React.useState({
    name: 'Cat in the Hat',
    age: '',
    multiline: 'Controlled',
    currency: 'EUR',
  });

  const handleChange = name => event => {
    setValues({ ...values, [name]: event.target.value });
  };

  return (
    <form className={classes.container} noValidate autoComplete="off">
      <TextField
        id="standard-name"
        label="Name"
        className={classes.textField}
        value={values.name}
        onChange={handleChange('name')}
        margin="normal"
      />
      <TextField
        id="standard-uncontrolled"
        label="Uncontrolled"
        defaultValue="foo"
        className={classes.textField}
        margin="normal"
      />
      <TextField
        required
        id="standard-required"
        label="Required"
        defaultValue="Hello World"
        className={classes.textField}
        margin="normal"
      />
      <TextField
        error
        id="standard-error"
        label="Error"
        defaultValue="Hello World"
        className={classes.textField}
        margin="normal"
      />
      <TextField
        disabled
        id="standard-disabled"
        label="Disabled"
        defaultValue="Hello World"
        className={classes.textField}
        margin="normal"
      />
      <TextField
        id="standard-password-input"
        label="Password"
        className={classes.textField}
        type="password"
        autoComplete="current-password"
        margin="normal"
      />
      <TextField
        id="standard-read-only-input"
        label="Read Only"
        defaultValue="Hello World"
        className={classes.textField}
        margin="normal"
        InputProps={{
          readOnly: true,
        }}
      />
      <TextField
        id="standard-dense"
        label="Dense"
        className={clsx(classes.textField, classes.dense)}
        margin="dense"
      />
      <TextField
        id="standard-multiline-flexible"
        label="Multiline"
        multiline
        rowsMax="4"
        value={values.multiline}
        onChange={handleChange('multiline')}
        className={classes.textField}
        margin="normal"
      />
      <TextField
        id="standard-multiline-static"
        label="Multiline"
        multiline
        rows="4"
